я салфетница давно хотела что то не обычное", "2020-07-09T06:40:24.94993586Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "254": ["Классная салфетница.", "2020-07-09T04:24:37.428810755Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "255": ["Очень понравилась, на праздничный стол просто супер 😍", "2020-07-08T20:25:39.939897728Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "256": ["Мне очень понравилась, смотрится очень мило.\nУпаковано всё было хорошо.", "2020-07-08T17:05:09.804599692Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "257": ["Пришла в целости!красивая салфетница )и упакована хорошо,не стыдно в подарок приобрести 👍🏻", "2020-07-08T13:13:47.008078203Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "258": ["Заказывала сразу несколько разных фигурок на подарки. Данная пришла в помятой коробке и упакована в пакет, а не в пленку как все. Дома, достав, увидела брак, отколоты пальцы на руке и полоса вдоль туловища. Явно этот товар сдавали не один раз, зачем надо было намеренно добавлять в заказ. Если много беру можно и брак впихнуть?! Буду, естественно, сдавать! За это даже 1 звёзды много!!!", "2020-07-06T20:31:26.775357803Z", "коричневый", "0", 4, 2, 1, "Салфетница \"Элегантная\"", "Artipolis"], "259": ["Салфетница обалденная!))) Пришла в целостности и сохранности)) На фото казалось меньшего размера, в реальности даже лучше))", "2020-07-04T09:23:02.348458629Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "260": ["Брали на подарок \nВсем очень понравилось", "2020-07-02T18:44:47.042663616Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "261": ["Пришла в целостности и сохранности. Очень красивая и нежная. Поэтому заказала сразу вторую для мамы. ", "2020-07-02T12:36:52.260891429Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "262": ["Супер  вещь", "2020-07-02T11:24:24.394055354Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "263": ["Салфетница пришла с браком, поэтому возврат.", "2020-07-01T08:45:30.756475307Z", "коричневый", "0", 1, 0, 4, "Салфетница \"Элегантная\"", "Artipolis"], "264": ["Заказывала несколько разных , в подарок подругам  . Все пришли в целости и сохранности . Очень понравились . Эту красотку оставила себе .", "2020-06-30T18:16:20.332437245Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "265": ["Шикарные, заказывала 2, себе и на подарок, пришли без брака, отдично смотрятся, устойчивые и оригинальные.", "2020-06-30T09:51:34.133723999Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "266": ["Классная салфетница. Оригинальная. Была в красивой упаковке. Стоит прочно. Салфетки вставляются и держатся в форме юбочки. Необычно! Советую себе и для подарка.", "2020-06-28T17:52:08.119621702Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "267": ["Девушка-салфетница прекрасна! Салфетки держатся на ней крепко, можно спокойно переносить. Редкая вещь, от которой чувствуется душевное тепло, наверное, из-за того, что выполнена из дерева.", "2020-06-28T17:43:50.167921366Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "268": ["Нет слов, шикарная!", "2020-06-28T17:15:43.195212703Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "269": ["Салфетница очень понравилась! Необычная, стильная, отлично вписалась в интерьер! Качество хорошее.", "2020-06-28T03:23:52.28008253Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "270": ["Салфетница сама по себе сделана качественно. Выглядит презентабельно,  на \"мини\" подарок подойдёт отлично.  Но чтобы она смотрелась красиво с салфетками, нужно очень постараться... Я смотрю по отзывам,  многие не заморачиваются,  и вставляют салфетки как придётся, но чтобы было эстетически красиво,  нужно чтобы \"бумажная\" юбка девушки, начиналась от талии, и вот в этом вся загвоздка.... Я тратить время на это не стала, так  как слишком много не нужных усилий следует приложить,  поэтому  оставила просто в качестве статуэтки. Но считаю,  что для указанных размеров салфеток ( а другие размеры туда просто не подойдут), следует сделать рост девушки чуть пониже,  и опустить линию талии.", "2020-06-27T17:23:22.217356089Z", "коричневый", "0", 2, 0, 4, "Салфетница \"Элегантная\"", "Artipolis"], "271": ["Красивая салфетница. Пришло все в коробке, аккуратно. ", "2020-06-24T17:07:26.357462029Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "272": ["Очень довольна приобретением такой оригинальной салфетницы. Заказывала две штуки, брака нет, закажу ещё. А пока любуюсь красотой, надо теперь и салфетки под стать такой красавице приобретать!", "2020-06-23T03:47:22.767458966Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "274": ["Отличная подставка! Не маленького размера. Очень понравилось. На подарок отлично!", "2020-06-22T11:35:48.831404742Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "275": ["Самая красивая, очень утонченная «девушка» - салфетница из представленных вариантов. Со скидкой цена привлекательная. К покупке рекомендую. Спасибо производителям за идею.", "2020-06-19T16:43:12.966169026Z", "коричневый", "0", 14, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "276": ["Симпатичная салфетница", "2020-06-17T16:05:13.823550854Z", "коричневый", "0", 5, 4, 5, "Салфетница \"Элегантная\"", "Artipolis"], "277": ["Действительно элегантная! Классная штучка!", "2020-06-16T17:40:12.50155573Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "278": ["Красивая, стильная! В подарок отличное решение. Салфетница, кто любит такие интересные вещи, которые делают наш дом уютным!!!!", "2020-06-15T02:26:58.634249757Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "279": ["Очень красивая! Доставлена в целости и сохранности! Оригинальная вещь!", "2020-06-14T07:33:08.41774148Z", "коричневый", "0", 7, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "280": ["Классно смотрится!", "2020-06-12T12:21:03.044619782Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "281": ["Изящная, милая девушка-салфетница 👍🏻", "2020-06-11T18:21:18.647162572Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "282": ["Красота! Оригинально, красиво, очень всё здорово)", "2020-06-10T20:16:23.167491741Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "283": ["Все как на фото. Красиво, но цена все же завышена (себестоимость то копеечная)", "2020-06-10T19:03:37.877936998Z", "коричневый", "0", 2, 8, 4, "Салфетница \"Элегантная\"", "Artipolis"], "284": ["Очень симпотично👍🏻", "2020-06-08T15:39:52.489698691Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "285": ["Из фанеры, не совсем устойчивая, лёгкая, на фото гораздо лучше смотрится.", "2020-06-06T16:09:04.413017924Z", "коричневый", "0", 0, 1, 3, "Салфетница \"Элегантная\"", "Artipolis"], "286": ["Товар пришёл быстро, в аккуратной не мятой коробочке. Не вскрывала, потому что брала на подарок", "2020-06-06T11:56:25.723578884Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "287": ["Все как на картинке. Фигура изящная, деревянная, высокая (выше других). Коробка тоже выглядит красиво, отлично подойдёт для подарка. Спасибо за быструю доставку! ", "2020-06-04T19:34:35.072526484Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "288": ["Сама фигурка милая и декоративная, мне понравилась.  Но повертев ее в руках и вложив несколько салфеток, я осталась не довольна. Пока салфетки сложишь и разместишь в эти щелки,  они становятся засусленными. Использовать по назначению не буду.", "2020-06-03T19:18:52.680292059Z", "коричневый", "0", 1, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "289": ["Очень красивая салфетница. Но салфетки постепенно начинают сползать вниз, и \"юбочка\" начинает смотреться не очень аккуратно.", "2020-06-01T15:27:45.655473305Z", "коричневый", "0", 1, 1, 4, "Салфетница \"Элегантная\"", "Artipolis"], "290": ["Очень красивая вещь. Все понравилось. Соответствует картинке и описанию. Удобно в эксплуатации. Материал - дерево. Хорошо упакована.", "2020-05-31T10:35:52.533640841Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "291": ["Смотрится очень здорово и мило украсит стол и в будни, и в праздник👍", "2020-05-31T09:06:15.384194138Z", "коричневый", "0", 11, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "292": ["Очень красивая.", "2020-05-29T11:49:19.174495837Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "293": ["Одним словом - красота!", "2020-05-28T13:05:46.726476603Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "294": ["Какая же она красивая. ", "2020-05-27T06:04:27.143559765Z", "коричневый", "0", 15, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "295": ["Красивая салфетница. Деревянная. Рекомендую.", "2020-05-26T20:35:43.957241981Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "296": ["Очень изящная вещь! Приобретайте без всяких сомнений. Кстати, приходит в красивой коробке. Можно покупать для подарка. ", "2020-05-26T20:02:44.057750152Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "297": ["Очень понравилась солфетница, берите не пожалеете!", "2020-05-25T05:41:34.047521942Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "298": ["Очень красивая и оригинальная вещь. Пришла быстро и без всяких изъянов.", "2020-05-24T20:13:29.498104476Z", "коричневый", "0", 8, 12, 5, "Салфетница \"Элегантная\"", "Artipolis"], "299": ["Очень приятная вещь! ", "2020-05-22T12:30:11.339904919Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "300": ["Классная штука для салфеток, пришла правда не та которую заказала но не страшно, эта тоже прикольная!", "2020-05-22T09:58:03.23602439Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "301": ["Мне очень понравилось! Качество и подача (была привезена в фирменной коробке). Можно брать на подарок. Платье будет зависеть от ваших салфеточек.", "2020-05-21T11:48:09.815307243Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "302": ["Потрясающая салфетница. Размер больше, чем я думала. От этого смотрится ещё лучше. Рекомендую. Отличный подарок", "2020-05-20T17:45:55.225614703Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "303": ["Сама фигурка огонь!! Но доставка магазина желает лучшего! Прислали не ту фигурку что я заказывала!! Оставила на подарок. Себе придется новую такую же заказывать. Но где гарантия что придет то что нужно?", "2020-05-19T21:41:43.159384284Z", "коричневый", "0", 1, 0, 3, "Салфетница \"Элегантная\"", "Artipolis"], "304": ["Супер! Наша красавица! Радует! РЕКОМЕНДУЮ!", "2020-05-19T08:43:46.218193782Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "305": ["Вот такую оригинальную штучку мы приобрели 👍👍👍", "2020-05-18T20:35:48.234963927Z", "коричневый", "0", 8, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "306": ["Подарил супруге, она любит украшать столы дома. Вообще огонь штука, красиво и по делу. Пахнет деревом... В общем стоит своих 349 рублей но не больше.", "2020-05-17T12:51:40.940823174Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "307": ["Все хорошо, кроме цвета, перекрасила в белый.", "2020-05-15T17:47:25.07349836Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "308": ["Нарядная салфетница. Подарила ещё и подругам. Все довольны.", "2020-05-15T14:21:10.215289731Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "309": ["Спасибо. Очень классная салфетница.", "2020-05-15T08:46:49.590928163Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "310": ["Очень хорошее качество и оригинально!", "2020-05-14T15:30:08.339429459Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "311": ["Салфетница пришла в идеальном состоянии, коробка была запаена в заводскую упаковку.", "2020-05-13T20:23:39.217728816Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "312": ["Пришла целая. Очень элегантная салфетница и оригинальный подарок 👍🏻", "2020-05-12T15:23:05.939960082Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "314": ["Она прекрасна!))) Пришло две штуки, обе целые!)", "2020-05-12T00:07:34.54551135Z", "коричневый", "0", 13, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "316": ["Очень красивая салфетница,упаковка хорошая ,можно на подарок брать", "2020-05-11T17:05:05.137194702Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "317": ["Хорошая салфетница. Оригинально для подарка.", "2020-05-10T10:39:12.660217037Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "318": ["Понравилась. Смотрится очень красиво. ", "2020-05-09T19:09:21.7593206Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "319": ["Очень элегантная, красивая салфеток ца. На маленьком столе смотрится объемно. Но отлично смотрится на большом столе. Доставка была из Москвы. Упаковано все хорошо. Доставка в срок. Огромное спасибо.", "2020-05-09T10:25:02.336573868Z", "коричневый", "0", 8, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "320": ["Салфетница пришла  без брака  спасибо магазину", "2020-05-07T15:26:37.176498988Z", "коричневый", "0", 5, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "321": ["восхищение и огромное спасибо производителю за такую оригинальную и изящную салфетницу, взяла на подарки коллегам  и себе,  радует и надпись на подставке, еще раз огромное спасибо, на кухне радует глаз)", "2020-05-07T06:58:25.0340407