9Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "344": ["Оригинальный элемент декора кухни. Мне очень нравится. ", "2020-04-13T16:42:44.83961442Z", "коричневый", "0", 4, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "345": ["Салфетница Artipolis  \"Элегантная\" - красивый и интересный атрибут для сервировки как праздничного так и ежедневного стола, стильный предмет интерьера. Необычно, оригинально, изящно, очень мило, очаровательно и элегантно. Превосходный вариант подарка.\r\nТовар в собранном виде упакован в плотную картонную коробку (повреждений упаковки нет). Есть незначительные дефекты на самой фигурке, которые заметны при внимательном детальном рассмотрении на близком расстоянии. Однако придираться к ним не буду. Явного брака не обнаружено. Претензий к качеству нет. Выкупила.\r\nДля формирования юбки использовала 22 однослойных салфетки размером 24*24 см. Как получилось можно увидеть на фото.\r\nПокупкой очень довольна. Приобрела за 359 руб. Эта красотка теперь радует мой взор ежедневно на кухонном столе. Рекомендую.\r\nСпасибо производителю и WILDBERRIES за товар и доставку.", "2020-04-13T13:14:48.492836607Z", "коричневый", "0", 11, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "346": ["Отличная салфетницу. Рекомендую", "2020-04-12T08:43:19.318913998Z", "коричневый", "0", 7, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "347": ["Отличная, пришла без брака, заказала ещё   в подарок.", "2020-04-11T09:52:50.912280397Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "348": ["Шикарные салфетницы!!! Брала в подарок, очень понравились,теперь хочу такую же себе. Пришли целые, коробка очень крепкая и удобная. Упаковано хорошо.", "2020-04-10T21:22:41.248718743Z", "коричневый", "0", 8, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "349": ["Очень милая и оригинальная салфетница! Шикарный подарок! Упакована в красивую коробку. Коробка пришла без повреждений.", "2020-04-10T04:14:54.976090189Z", "коричневый", 