етница \"Элегантная\"", "Artipolis"], "496": ["Пришла в коробке уже собранная, оооочень здоровская вещь и на подарок можно", "2020-01-23T16:41:28.261050691Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "497": ["Замечательная и интересная вещица.Смотрится на столе очень интересно.Пришла великолепно упакованная.Заказала несколько разных видов в качестве подарка.Всем очень понравилось.Спасибо😊", "2020-01-22T15:36:16.086149459Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "498": ["Качество супер! Красота!", "2020-01-22T07:32:12.101882506Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "499": ["Очень красиво и изящно, с любыми салфетками! Качество прекрасное! Спасибо производителю и WB!", "2020-01-20T14:05:55.965083959Z", "коричневый", "0", 10, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "500": ["Пришла с браком ", "2020-01-20T12:15:19.67243212Z", "коричневый", "0", 2, 0, 1, "Салфетница \"Элегантная\"", "Artipolis"], "501": ["Очень красиво, изящно и необычно. Вы выполнена качественно. Я довольна, как слон)", "2020-01-20T09:19:53.169653458Z", "коричневый", "0", 15, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "502": ["Салфетница красивая, много помещается салфеток и в зависимости от их размера у барышни платье может быть очень пышное, а может быть скромнее)\r\nЭлегантно и со вкусом, надо еще поискать подобное исполнение для сервировки.", "2020-01-20T08:03:02.158287334Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "503": ["Салфетница пришла хорошо упакованная, без изъянов. Брала на подарочек подруге к 8 марта. Надеюсь ей так же понравится. Миленькая штучка на праздничный стол.", "2020-01-19T17:31:02.086709881Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "504": ["Салфетницы прекрасны.Взяла на подарки к8марта своим знакомым\nСпасибо производителю и wb.", "2020-01-19T13:23:03.67808869Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "505": ["Отличное украшение любого стола! Все пришло в идеальном состоянии.", "2020-01-19T12:49:52.201005923Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "506": ["Салфетница супер,доставили без брака", "2020-01-19T11:02:09.166177938Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "507": ["Прислали другую салфетницу - светлее и другой формы, нужна была именно тёмная под интерьер, а так бы оставили..Красивая и хорошо упакована.", "2020-01-17T09:55:42.09948105Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "508": ["Классная, рекомендую!", "2020-01-16T09:49:26.783765615Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "509": ["Отличная салфетница, очень красивая! Рекомендую 100%", "2020-01-15T18:15:24.88365583Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "510": ["Салфетница очень миленькая. Покупала два раза. Оба раза товар хорошо упакован,коробки не мятые. Сама салфетница доставила удовольствие их обладательницам. Смотрится на самом деле,как на картинке. Очень-очень красиво. И платья у салфетниц разные можно сделать,в зависимости от рисунка и цвета салфеток. Рекомендую товар!!!", "2020-01-15T16:17:39.258804118Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "511": ["Салфетница, просто супер, буду брать ещё на подарок!", "2019-12-12T04:35:56.161841671Z", "коричневый", "0", 7, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "512": ["Очень красивая, взяла на подарок, рекомендую!", "2020-01-15T11:31:03.504086929Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "513": ["Салфетница прекрасная! Оригинальная! Нигде не видела раньше. Пришла без брака! Буду заказывать ещё на подарки.", "2020-01-15T09:53:30.041399417Z", "коричневый", "0", 5, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "514": ["Великолепная вещь! Спасибо производителям! Хотелось бы видеть на сайте полный каталог ваших моделей салфетница, поскольку быстро раскупается и очень долго ждать поступления", "2020-01-11T22:48:51.411400109Z", "коричневый", "0", 8, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "516": ["Брала на подарок свекрови, она в восторге. Мне тоже понравилась салфетница, теперь хочу и себе)", "2020-01-14T19:17:18.078403095Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "517": ["Отличная салфетница, эта была уже  десятая на подарок(брала разные), но в последний раз не повезло, расслоение на лепестке. Перезакажу.", "2020-01-14T14:09:08.02873361Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "518": ["Очень красивая! Взяла в подарок и себе. Советую", "2020-01-14T14:07:57.443142186Z", "коричневый", "0", 12, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "519": ["Упаковка целая ,отличный и элегантный подарок", "2020-01-14T09:03:32.734008416Z", "коричневый", "0", 10, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "520": ["Красота буду наряжать на столе )))рекомендую", "2020-01-13T14:41:12.57759517Z", "коричневый", "0", 3, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "521": ["*****Шикарная салфетница******* Советую....", "2020-01-13T09:01:10.635515406Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "522": ["Очень красивая, качественная! Упакована замечательно. На подарок просто супер. ", "2020-01-12T10:05:12.698267553Z", "коричневый", "0", 11, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "523": ["Очень красивая, элегантная и полезная вещица. Украшает стол, салфетки из неё удобно брать по одной. Единственная сложность для меня - прорези узковаты, салфетки сложновато вставляются.", "2020-01-12T06:08:13.487378523Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "524": ["Интересная салфетница. Всё как на фото.", "2020-01-11T19:08:02.598199644Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "525": ["А я вот решила поиграть с цветом под интерьер, получилось )) ", "2020-01-11T16:54:45.375357285Z", "коричневый", "0", 18, 2, 5, "Салфетница \"Элегантная\"", "Artipolis"], "526": ["Очень красивая салфетница! Качество отличное. Оригинальный вариант для подарка (предусмотрена упаковка). Рекомендую. Больше всего понравилась «Элегантная»", "2020-01-11T15:26:48.07600141Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "527": ["Замечательно! И товар  красивый и  упаковка - красивая коробка.", "2020-01-11T14:41:44.982161639Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "528": ["Заказала две салфетницы, обе пришли хорошо упакованы, коробки неповрежденные. Салфетницы без царапин. Очень изящные. Спасибо производителю.", "2020-01-11T10:26:23.607417541Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "529": ["Миленько. Для подарочка. Приятно будет.", "2020-01-10T08:45:08.544497709Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "530": ["Салфетницей довольна. Доставлена в симпатичной упаковке. Прям подарочный вариант. Салфетница с таким названием \"Элегантная\" - на самом деле элегантная!!!!!!!! Рекомендую!!!!", "2020-01-10T06:10:49.240185882Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "531": ["Брала в подарок подруге. Салфетница хорошо прокрашена, обработана. Упаковка надёжно сберегает все части деревянной конструкции. Я осталась довольна покупкой 😊", "2020-01-09T18:53:41.553785162Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "532": ["Очень понравилась. Смотрится красиво. Без брака. На коробке есть инструкция, которая помогает вынуть изделие аккуратно, не сломав его, так как салфетницу держит картонный фиксатор. Очень рада покупке!", "2020-01-09T14:57:53.074404398Z", "коричневый", "0", 15, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "533": ["Пришло все упаковано, даже с инструкцией как открывать и извлекать. Салфетница  понравилась, оригинальная.", "2020-01-09T05:31:48.149030065Z", "коричневый", "0", 8, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "534": ["Брала на подарок. Вещица супер, все остались довольны. Огромное спасибо", "2020-01-07T19:25:17.598156947Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "535": ["Спасибо большое производителю этой оригинальной салфетницы. Сделано с любовью, высокого качества.", "2020-01-07T15:40:41.083016582Z", "коричневый", "0", 5, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "536": ["Гениальная вещь! Фигурка довольно высокая, но можно \"поиграть\" с формой юбки, если складывать салфетки по-разному. А можно вставлять туда записки\\конверты, вешать мелкие предметы, типа цепочек и т.п. Невероятно стильно и элегантно смотрится! Для подарка женщинам лучше и не придумаешь (если еще и в купюры одеть)). Спасибо дизайнерам!", "2020-01-07T15:18:44.965784594Z", "коричневый", "0", 14, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "537": ["Мы в восторге! Очень элегантная , красивая и не очень много места занимает, если салфетки правильно сложить", "2020-01-06T18:27:17.155023651Z", "коричневый", "0", 7, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "538": ["Утонченная вещица!", "2020-01-06T12:15:22.730680091Z", "коричневый", "0", 11, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "539": ["Очень красивая! Но занимает довольно много места", "2020-01-06T16:33:19.906693428Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "540": ["Брала на сувениры , всем очень понравилось ", "2020-01-06T15:09:01.504777706Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "541": ["Очень красивая салфетница. Брала на подарок. Всем очень понравилась. Качественно сделана и отлично упакована. Рекомендую", "2020-01-06T05:19:00.07696733Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "542": ["Не ожидала, что она такая большая. Взяла, но куда ее ставить понятия не имею. Если сервировать маленький столик, то салфетница займет половину стола.", "2020-01-05T19:38:32.012098176Z", "коричневый", "0", 2, 3, 4, "Салфетница \"Элегантная\"", "Artipolis"], "543": ["Заказала 3 штуки на подарки. Все пришло. Коробки запакованы , не мятые. Все целое. Очень довольна. Только салфетки нужны большего размера.", "2020-01-05T08:28:45.647907952Z", "коричневый", "0", 10, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "544": ["Товар пришел в целой  упаковке, на коробке надпись как правильно открывать и доставать статуэтку, чтоб не сломать. Симпатичная статуэтка, темное дерево, сколов, заусениц на дереве нет, качество хорошее. Размер немного крупнее, чем представляла себе, но всё равно красивая вещь. Взяла на подарок.", "2020-01-05T07:48:15.43473569Z", "коричневый", "0", 8, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "545": ["Заказала Салфетницы Элегантная и Сюзанна на подарок к НГ, привезли две штуки Берлинский вечер! Это совсем не то, что я хотела, времени менять уже не было, одну пришлось оставить, на вторую оформляю возврат.Лучше бы склад повнимательнее работал, а не бегом отгружал первое попавшееся, да еще и подозреваю более дешевое! Неприятное чувство обмана", "2020-01-04T08:42:54.460795349Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "546": ["Красивая. Сделана из дерева", "2020-01-03T12:08:54.221019294Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "547": ["Салфетница отличная! Берите- не пожалеете. Брала на подарок. Всем понравилась. Изящная вещица!", "2020-01-02T17:26:01.529364343Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "548": ["Качественная подставка, брала в подарок на новый год. Очень понравилась.", "2020-01-02T15:46:54.941688572Z", "коричневый", "0", 8, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "549": ["Салфетница пришла с отломанным элементом. Возврат. Прошу не учитывать в проценте выкупа. ", "2020-01-02T12:07:33.294978137Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "551": ["Отлично, можно брать.", "2020-01-02T06:26:56.823166751Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "552": ["Вместо заказанной салфетница \"Элегантная\" прислали \"Сюзанну\". Прошу разобраться и не учитывать в процент выкупа. ", "2020-01-01T20:11:56.748880842Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "553": ["Брали в подарок, вещь качественная. Хорошая упаковка", "2020-01-01T15:34:35.442600142Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "554": ["Купила себе в подарок. Классная вещь.", "2019-12-30T15:24:24.333760827Z", "коричневый", "0", 11, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "555": ["Пришлось отказаться.  ", "2019-12-29T14:25:41.692841865Z", "коричневый", "0", 25, 1, 3, "Салфетница \"Элегантная\"", "Artipolis"], "556": ["Красивая деревяна салфетница, сделана качественно. Мне очень понравилась.", "2019-12-19T08:09:28.962080587Z", "коричневый", "0", 7, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "557": ["Красивая салфетница, очень качественно сделано. Упаковано хорошо.", "2019-12-28T21:49:54.438691941Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "558": ["Очень красивая дама . Для подарка , прекрасная идея. Но вот только цена сейчас завышена . Брала по 417р . Сейчас в 2 раза дороже из праздников.", "2019-12-24T17:58:39.79051102Z", "коричневый", "0", 11, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "559": ["Заказа 3 таких дамы . Выкупила , т.к спешила . А дома только обнаружила , что одна из них совершенно другаЯ. Очень не приятно , почему поставщик не указал об этом. Проверяйте на месте. ", "2019-12-28T16:44:27.065996862Z", "коричневый", "0", 1, 0, 1, "Салфетница \"Элегантная\"", "Artipolis"], "560": ["Очень красивая и необычная салфетница. Покупала для праздников. Думаю гости оценят в НГ.", "2019-12-28T10:06:45.265506239Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "561": ["Очень красивая! Браво авторам! Невероятно элегантная вещь!", "2019-12-25T10:28:00.218041971Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "562": ["Очень милая и нежная салфетница)\nПрекрасное качество и задумка. \nЦена 426 руб.\nМужу и сыну очень нравится, даже салфетки из неё не берут)))))(стоит, как декор)", "2019-12-25T08:50:52.22683749Z", "коричневый", "0", 20, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "563": ["Салфетница очень красивая, покупала за 399 рублей)", "2019-12-25T05:02:11.857400194Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "564": ["Очень понравилась салфетница💃🏼 Очень качественно сделано. Украшает стол. Позитивно,красиво, изящно,оригинально!!!💥💥💥💥💥Всем спасибо👍🏻🎄🎄🎄🎅🏻", "2019-12-25T04:54:12.371974399Z", "коричневый", "0", 12, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "565": ["Красивая салфетница, прекрасно для подарка! Но цена явно завышена! ", "2019-12-24T19:29:46.28131074Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "566": ["Отлично! Качественно и красиво! Пришло все в хорошем состоянии , на подарок идеально ", "2019-12-24T18:48:49.437111883Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "567": ["Красивые салфетницы, качественное исполнение, упаковка хорошо продуманная, и в плане транспортировки и в плане презентабельности. Покупала на подарки несколько недель назад за 334 руб., сейчас цена на 200 руб. дороже, явно завышена.", "2019-12-20T06:59:29.724185975Z", "коричневый", "0", 21, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "569": ["Салфетницы не плохие, хорошие, но цена явно завышенна, покупала за 600 рублей(3шт в подарок) , даже это для них дороговато, хоть хорошо и упакованы, но ожидала что будут помассивнее, легенькая фанерка, в целом мне все очень понравилось, но цена завышенна, а сейчас подняли ещё выше цену, считаю что дорого за такую цену!!!!", "2019-12-23T22:06:39.150124576Z", "коричневый", "0", 11, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "570": ["Классная салфетница. Пришла хорошо упакованная, на коробке целая инструкция как ее надо открыть, что б не сломать! Салфетки не все подходят. Но это не страшно", "2019-12-23T19:23:47.198140592Z", "коричневый", "0", 10, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "571": ["Очень крутая! Рекомендую!", "2019-12-23T09:06:37.373708147Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "572": ["Оригинально и не избито! С Новым, 2020 годом!", "2019-12-22T13:08:40.04320206Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "573": ["Покупала такую салфетницу в ноябре за 385 рублей. Красота ! Но сейчас цена  ого  как подскочила! А так для подарка очень хороша!", "2019-12-21T20:38:31.042727246Z", "коричневый", "0", 7, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "574": ["Заказала 3 штуки. Все пришло целым и качественным. Для подарка-просто супер. Спасибо!", "2019-12-21T13:23:36.64464172Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "575": ["Шикарная! Для подарка самое то! \r\nОгорчает только то, что цена так сильно выросла на эти салфетницы за пару недель. Думаю, после Нового года подешевеют, если останутся в наличии))", "2019-12-21T07:57:14.00209594Z", "коричневый", "0", 7, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "576": ["Такое разнообразие салфетниц из этой серии, что прикупила себе домой двух «девушек». Все очень красивые. Салфетница прочная, оригинальная, красивая. Рекомендую. Уже год пользуюсь (сын 3г также «одевает» ее и потом пользуется салфетками , ничего не отклеилось, не поломалось). ", "2019-12-19T22:10:07.582204787Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "577": ["Очень красивая.", "2019-12-19T18:24:06.649165232Z", "коричневый", "0", 7, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "578": ["Очень симпатичная вещица. В комплекте с салфетками отличный подарок.", "2019-12-19T17:12:39.424953613Z", "коричневый", "0", 5, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "579": ["Очень красивая салфетница! Покупала в подарок, несколько видов. Но думаю, что цена завышена.", "2019-12-19T13:18:13.595309797Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "580": ["Взяла в подарок. В презентабельной коробке. Теперь себе такую хочу...", "2019-12-18T19:18:13.604526699Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "581": ["Получила подставочку, осталась очень довольна, все соответствует описанию, упакована в красивую коробку в которой можно подарить", "2019-12-18T13:58:04.280975421Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "582": ["Подставка выглядит замечательно, упакована чудесно, как для подарка так это идеальный вариант.", "2019-12-17T14:52:33.450201327Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "583": ["Очень красивая салфетница. Упаковка достойная на подарок. Заказала две штуки, но одна пришла не та, пришлось отказаться от одной. ", "2019-12-17T11:47:07.758302988Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "584": ["Все в восторге!!!!! Спасибо производителям!!!!!", "2019-12-16T11:47:09.156201224Z", "коричневый", "0", 13, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "585": ["Все на высшем уровне! Спасибо производителю и WB! Шикарный подарок на любой праздник! Рекомендую обратить внимание на товары данного бренда.", "2019-12-16T08:19:17.961870875Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "586": ["Изящная вещица! Рекомендую и на подарок,и для себя.", "2019-12-16T07:18:26.801471755Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "587": ["Очень элегантная салфетница! Купила на  новогодний подарок. очень довольна товаром и доставкой!", "2019-12-15T18:23:05.128554364Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "588": ["Красивый дизайн, на столе смотрится очень элегантно. Конечно необходимо время, чтобы вставить салфетки, но красота требует жертв😊 Доставка  на 5", "2019-12-15T12:43:43.987880767Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "589": ["Очень изящная вещь! Упаковка отличная,взяла себе и на подарок.", "2019-12-15T11:09:11.512813245Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "590": ["Эффектная салфетница! Пришла целая и коробочка тоже, что очень обрадовало! Взяла на подарок. Надеюсь обладательница будет в восторге!!! Рекомендую.", "2019-12-14T13:57:16.190287288Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "591": ["Элегантная вещица, беру не первый раз на подарок - все в восторге! Очень оригинально и стильно! Украсит вашу кухню - это точно! Купите - не пожалеете!", "2019-12-14T12:55:23.298958287Z", "коричневый", "0", 6, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "592": ["Понравилась, прикольная", "2019-12-14T11:14:26.579253299Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "593": ["Очень красивая, изящная вешица. Купила в подарок, думаю себе такую тоже закажу. Настоящее украшение стола. ", "2019-12-14T10:31:59.272053561Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "594": ["Чудо! Рекомендую!", "2019-12-13T13:31:30.12237742Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "595": ["Отличная оригинальная салфетница, смотрится очень стильно.", "2019-12-13T13:12:21.385369564Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "596": ["Очень понравилась, брала на подарок-все упаковано,   коробка не помялась, хочу и себе такую. Спасибо", "2019-12-13T09:20:56.471378972Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "597": ["Super rekaminduyu", "2019-12-13T07:24:02.051768453Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "598": ["Очень красивая салфетница, идея оригинальная. Купила сначала в подарок, потом еще себе заказала. Для подарка очень хорошо, разумные деньги, упаковка красивая, не удешевляет.", "2019-12-13T07:01:35.559271463Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "599": ["Взяла в подарок сестре на новый год. Салфетница очень понравилась действительно такая изящная, невесомая. Купила за 370\"р.однозначно рекомендую к покупке. Упакована хорошо. Коробка пришла целая - не помятая.", "2019-12-12T16:05:16.483921986Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "600": ["Очень изящная вещица! Заказывала пять разных моделей, все пришли без брака, модели не перепутаны, претензий нет. Очень нарядно смотрится на столе и не нужен особый повод для этого. Взяла в подарок подругам и сестре. Вроде бы обычная вещь, но в таком необычном исполнении!", "2019-12-12T14:27:08.689852921Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "601": ["Хорошая салфетница! Необычный подарок на новый год. Заказывала несколько похожих салфетниц в подарок. Одну точно оставлю себе, т.к. коробка измята и, видимо, была подмочена - в таком виде для подарка не годится! К самой салфетнице претензий нет, все элементы на месте, обработка хорошая, окрашена салфетница равномерно! ", "2019-12-12T12:35:22.309814296Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "602": ["Очень красивая салфетница. Спасибо ", "2019-12-11T19:43:50.905665165Z", "коричневый", "0", 25, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "603": ["Она хороша,молодец,кто придумал необычную салфетницу", "2019-12-11T19:15:59.199489318Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "604": ["Она великолепна! Салфеток входит больше, чем в стандартную салфетницу - 21 шт.", "2019-12-11T14:25:43.496012643Z", "коричневый", "0", 10, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "605": ["Очень красиво", "2019-12-11T12:51:33.366717064Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "606": ["Очень симпатичная и оригинальная салфетница. Хорошо впишется в любой интерьер и его украсит. Тем более что \"юбку\" - \"платье\" можно менять на свой вкус и таким образом каждый день создавать новое настроение на кухне или за обеденным столом. Отлично подойдёт в качестве презента на новый год", "2019-12-11T03:28:38.402462159Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "607": ["Самый лучший выбор для подарка.", "2019-12-10T14:36:23.831929278Z", "коричневый", "0", 14, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "608": ["Вытаскивать салфетки прийдется придерживая статуэтку. Вынимать из коробки, чтобы не сломать, надо аккуратно, прочитав рекомендации на коробке, сначала верх, а потом снизу.а в целом оригинально и красиво", "2019-12-10T09:28:14.800731481Z", "коричневый", "0", 3, 0, 4, "Салфетница \"Элегантная\"", "Artipolis"], "609": ["Прелесть, очень изящная.", "2019-12-09T18:43:01.484716473Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "610": ["Очень красивая салфетница, качественно сделана, хорошо упакована в коробку. ", "2019-12-09T13:42:56.968224587Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "611": ["Купила  салфетницы двух видов \"Элегантная\" и \"Сюзанна\". Обе- само очарование. Сделаны аккуратно из натурального дерева. Покупкой очень довольна. Чудесный подарок получится из одной салфетницы, а вторую обязательно оставлю себе. Пришли в хорошей упаковке. Полностью соответствуют описанию.  Спасибо!!!", "2019-12-08T14:47:32.667267872Z", "коричневый", "0", 4, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "612": ["Очень изящная вещица. Работа тонкая. Упаковано очень хорошо. Брали на подарок, просто супер! Спасибо.", "2019-12-08T11:44:36.590855486Z", "коричневый", "0", 11, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "613": ["Очень красивая салфетница соответствует описанию, привезли на следующий день,", "2019-12-08T08:07:48.255778183Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "614": ["Замечательная идея и исполнение. Очень понравилась, взяла себе и на подарки к \r\nНовому году.  Качественно сделано, надежно упаковано. Рекомендую. Спасибо производителю и магазину.", "2019-12-07T17:50:12.573709165Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "615": ["Очень понравилась, рекомендую.пришло в коробке хорошо упаковано, все целое. очень достойная вещица. ", "2019-12-06T18:26:07.245883542Z", "коричневый", "0", 7, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "616": ["Шикарная дамочка! Элегантная, нежная, для праздничного стола самая подходящая красотка! Сделана хорошо, покраска без пробелов, ровная. Нам очень понравилась.", "2019-12-05T18:10:08.087948106Z", "коричневый", "0", 11, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "617": ["Очень красивая, изящная.", "2019-12-05T17:56:55.641721186Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "618": ["Очень довольна что купила такую красоту!Мило смотрится и удобна в обращении.Буду ещё заказывать на подарки.", "2019-12-02T17:59:57.156070076Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "619": ["Очень красивая салфетница. Спасибо валдберис!!", "2019-12-01T21:42:17.88538992Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "620": ["Очень довольна покупкой! Такая грациозная салфетница! Эффектно смотрится. А какая упаковка красивая! Сразу видно,что делали и упаковывали творческие люди. Спасибо за радость!", "2019-11-30T13:26:23.192341601Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "621": ["Заказывала в подарок сестре! Салфетница отличная, очень красивая!!! ", "2019-11-30T12:44:02.289776485Z", "коричневый", "0", 1, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "622": ["Очень нежная, красивая и качественная салфетница с логотипом фирмы. Красивого шоколадного цвета. Великолепная подарочная упаковка и продуманное крепление фигурки внутри неё.", "2019-11-29T21:25:19.655843526Z", "коричневый", "0", 24, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "623": ["Довольна покупкой ) закажу в подарок ещё одну 😁", "2019-11-29T19:53:56.628863714Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "624": ["Это просто чудо! Я очень довольна покупкой!", "2019-11-28T06:04:03.409255735Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "625": ["Спасибо, соответствует описанию классная вещица", "2019-11-27T19:33:55.168173626Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "626": ["Салфетница просто супер! Пришла в коробке, упакована! Такую можно и на подарок ! Я в восторге, очень красиво смотрится!", "2019-11-08T09:36:48.996403893Z", "коричневый", "0", 8, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "628": ["Очень оригинальная салфетница. Сначала взяла для себя, а потом дозаказала ещё 2 в подарок.", "2019-11-25T14:06:44.560392224Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "629": ["Получила салфетницу замечательно упакованную. Она хороша как украшение стола. Взяла на подарок, спасибо.", "2019-11-22T13:38:51.344699405Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "630": ["Хорошее качество, красивая вещь. Довольна покупкой. ", "2019-11-21T17:00:40.913998676Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "631": ["Очень милая, я бы даже сказала, изысканная вещица. Будет отличным украшением на столе.  Брала на подарок. Очень понравилась!", "2019-11-21T10:38:17.240451903Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "632": ["Класс! Оригинально!!!", "2019-11-20T18:46:50.695204883Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "633": ["Супер!! В целях экономии площади стола, юбку сделала по другому!! Доставайте фигуру из коробки снизу!!!", "2019-11-20T17:06:20.619390837Z", "коричневый", "0", 12, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "634": ["Прикольная штучка.", "2019-10-28T15:42:14.751964482Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "636": ["Очень красивая и качественная салфетница. Замечательно упакована в красивую коробочку. Отлично подойдет в роли подарка", "2019-11-19T15:17:28.893822883Z", "коричневый", "0", 1, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "637": ["Получила целой. Вещица изящная, но  занимает достаточно места на небольшом столе.", "2019-11-18T17:11:23.456565065Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "638": ["Получила без повреждений. Красивая упаковка. Выглядит достойно. Хорошее украшение стола. ", "2019-11-17T02:51:51.436037904Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "639": ["Красивая салфетница, сделана аккуратно. Главное, салфетки должны быть небольшими, салфетки большого размера смотрятся неаккуратно, и теряется весь эффект", "2019-11-16T17:28:47.807353035Z", "коричневый", "0", 7, 2, 5, "Салфетница \"Элегантная\"", "Artipolis"], "640": ["Заказываем не один раз, очень красивая вещь! Для себя и для подарка отлично подходит. Изящная! Всегда приходят без брака! Спасибо магазину!", "2019-11-16T03:57:12.741797318Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "641": ["Салфетница красивая, хорошо упакована. Покупала в подарок. Спасибо.", "2019-11-14T19:44:09.776294448Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "642": ["Классная подставка, в красивой коробке, подойдёт в подарок", "2019-11-11T08:36:13.358445154Z", "коричневый", "0", 2, 4, 5, "Салфетница \"Элегантная\"", "Artipolis"], "643": ["Подойдёт в подарок, упаковка - плотная коробка (см. на фото). Милая вещица! Даже с дешёвыми салфетками смотрится отлично! ", "2019-11-10T15:02:11.213442927Z", "коричневый", "0", 12, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "644": ["Красота!!!! Коробка и сам товар пришел в отличном состоянии (брала в подарок).", "2019-11-10T08:22:14.859227205Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "645": ["Очень понравилось, соответствует описаниям", "2019-11-09T15:22:17.522929194Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "646": ["Сплошное очарование! Бережно упаковано. Спасибо производителю!", "2019-11-09T12:49:42.089533802Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "647": ["Салфетница интересная, но дерево по центру силуэта плохо прокрашено, причём с 2-х сторон. Доставать из коробочки надо очень аккуратно, следуя инструкции внутри. Упаковка отличная, была ещё запечатана в полиэтилен. Подошли салфетки размером 12х12. Выкупила, чтобы не терять %, но осадочек остался.. Проверяйте свои салфетницы внимательно.", "2019-11-06T14:56:43.511875956Z", "коричневый", "0", 2, 3, 4, "Салфетница \"Элегантная\"", "Artipolis"], "648": ["Очаровательно!!! Брала на подарок.Упаковка просто супер-элегант только чего стоит.Буду заказывать себе.Нравится! Спасибо всем.", "2019-11-06T13:07:01.702102247Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "649": ["Очень изящная, ажурная салфетница. Смотрится необычно. Пришла в отличном состоянии, в эффектной подарочной коробочке. Спасибо производителю и любимому магазину))", "2019-11-06T11:33:24.529002565Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "650": ["Просто чудо, выше всяких похвал!!!!", "2019-11-05T17:12:08.047848005Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "651": ["Очень красивая подставка", "2019-11-05T13:50:46.69708957Z", "коричневый", "0", 8, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "652": ["Как говорится:,,Федот да не тот!?\" Качество, дизайн на высоте, только вместо 3-х Элегантных пришли 3 Сюзанны. Из двух заказов и 4-х салфетниц не получила ни одной,,Элегантной\".", "2019-10-30T07:40:46.628717344Z", "коричневый", "0", 1, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "654": ["Очень понравилась! Спасибо!", "2019-11-05T10:08:09.89347032Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "655": ["Пришла совершенно другая салфетница, дешевле заказанной. Я очень давно с wildberries , и ни как не ожидала такого. Неприятно. За это снимаю 2 звезды.", "2019-11-04T23:59:04.818819027Z", "коричневый", "0", 2, 3, 3, "Салфетница \"Элегантная\"", "Artipolis"], "656": ["Очень милая салфетница,упакована хорошо", "2019-11-02T12:49:08.103942893Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "658": ["Салфетница очень понравилась! Заказала ещё на подарки", "2019-11-03T17:32:14.027553392Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "659": ["Украшение моей кухни!", "2019-11-03T15:01:49.905003162Z", "коричневый", "0", 4, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "660": ["Заказала одно, пришло другое. Коробку явно вскрывали не раз. Больше заказывать не буду.", "2019-11-02T07:29:13.482338062Z", "коричневый", "0", 2, 5, 1, "Салфетница \"Элегантная\"", "Artipolis"], "661": ["Салфетница очень красивая! Можно брать на подарок. В ней 18 салфеток", "2019-11-01T15:32:58.948928824Z", "коричневый", "0", 14, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "662": ["Отличная подставка.", "2019-10-30T19:25:13.76073732Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "663": ["Очень красивая. Сделана аккуратно. Пришла целая, в целой коробке. Брала на подарок маме. Себе тоже  теперь такую хочу.", "2019-10-30T10:41:25.456174935Z", "коричневый", "0", 6, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "664": ["Очень красивая и удобная вещь для салфеток, выглядит как на картинке.", "2019-10-30T09:27:15.684446387Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "665": ["Салфетница очень эффектная.. Рекомендую 