,но когда стала вставлять салфетки,сзади сломались сразу палочки,хотя я очень аккуратно это делала,расстроились так,что ж это за качество такое,очень хрупкая,прям не дотронутся,очень обидно и деньги не малые.", "2019-04-18T11:43:43.705848159Z", "коричневый", "0", 3, 1, 2, "Салфетница \"Элегантная\"", "Artipolis"], "742": ["Салфетница великолепная, покупала на подарок, пазы не красятся, выглядит очень оригинально и достойно. Именно эта очень женственная. Да, для нее нужен большой стол, но смотрится очень эффектно.", "2019-04-18T04:34:51.169761325Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "743": ["Побоялась взять, занимает много места", "2019-04-15T19:49:12.651712771Z", "коричневый", "0", 3, 2, 4, "Салфетница \"Элегантная\"", "Artipolis"], "744": ["Очень симпатичная салфетница-украшение стола!!!Но надо иметь ввиду,что установив салфетки,как я,она занимает на столе немало места.А так нежная и симпатичная.Хороша для подарка!!!", "2019-04-07T06:17:49.112578166Z", "коричневый", "0", 12, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "745": ["Оригинальная и очень красивая салфетница! Покупкой довольна!", "2019-04-01T17:27:04.608992821Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "746": ["Вчера получила салфетницу, коробка измята , без защитной пленки, открыла , а салфетница сломана, и вытащить ее просто невозможно.. Единственный минус мой, сначала рассчиталась, потом начала проверять. Оставила заявку на воврат товара, но всё ещё на рассмотрении. Уважаемый магазин, зачем отправлять в таком виде товар? Мало того что коробка испорчена , так и содержимое коробки сломано, неужели нельзя проверять перед отправкой товар? Ведь , заказывают люди на подарок! Я заказала уже вторую такую салфетницу, очень понравилась когда подарила, и мне ещё заказ сделали на такую. Очень неприятно , когда вот так относятся к работе. Надеюсь , магазин примет обратно бракованный товар. ", "2019-03-29T07:45:56.329679576Z", "коричневый", "0", 5, 1, 1, "Салфетница \"Элегантная\"", "Artipolis"], "747": ["На фото выглядит поэффектней. Но ничего, занятная)", "2019-03-26T16:15:47.659789635Z", "коричневый", "0", 0, 1, 4, "Салфетница \"Элегантная\"", "Artipolis"], "748": ["Салфетница пришла сломанная!Я её так ждала!Надеюсь на проценте выкупа не отразится!", "2019-03-05T02:01:51.528139201Z", "коричневый", "0", 2, 0, 1, "Салфетница \"Элегантная\"", "Artipolis"], "749": ["Очень необычная милая вещица. Рекомендую.", "2019-02-28T20:17:15.29207337Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "750": ["Очень довольна. Красота. Стол смотрится очень празднично.", "2019-02-27T05:55:38.885833099Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "751": ["Очень красивая салфетницы, качественная и оригинальная. Для подарка на 8 марта подходит отлично))", "2019-02-27T03:50:45.020858302Z", "коричневый", "0", 2, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "752": ["Заказывала в подарок 2 штуки. Пришло всё герметично упаковано, все целостно. Выглядит очень нежно, приятно пахнет деревом. Надеюсь подарком угожу", "2019-02-26T05:47:59.796896085Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "754": ["Пригла сломанная 😭", "2019-02-10T08:44:14.567362665Z", "коричневый", "0", 0, 1, 1, "Салфетница \"Элегантная\"", "Artipolis"], "755": ["Очень красивая салфетница и отличный подарок подружке к 8 Марта. Заказывала три разных. Все пришли без брака и отлично упакованные.", "2019-02-06T12:17:35.423789844Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "756": ["Пришла в отличном состоянии, хорошо упакована, понравилась. Картинке соответствует. Спасибо! ", "2019-02-01T20:41:45.141734216Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "757": ["Брала на подарок маме. Пришло в упаковке, все целое. Салфетница крутая. Спасибо WB.", "2019-01-28T20:33:46.552628903Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "758": ["Заказывала три штуки, \"Элегантная\"  оказалась очень изящной и очаровательной. Но, проверяя салфетницы при курьере оказалось, что одна из них, к огромному моему сожалению, бракованная. Не держалась на подставке, подставка  после вскрытия коробке сразу же отпала. А когда вставили салфетницу в ножку, то сильно болталась, не фиксировалась. Так что, пришлось отказаться.  Прошу не учитывать в проценте выкупа. Салфетницы заказывались для подарков, а две салфетницы с браком у меня уже есть.   А так очень хорошенькие.", "2019-01-27T11:41:13.404752189Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "759": ["Покупала разных на подарки, всем очень понравились.", "2019-01-23T21:07:13.401754549Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "760": ["Очень понравилась! Смотрится оригинально!", "2019-01-23T15:13:20.695919526Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "761": ["Очень красивая, берите не пожалеете! Украшение стола!!", "2019-01-21T14:33:47.383174867Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "762": ["Немного с браком, отломаны одинтлеписток. но незначительно. Статуэтка красивая. Оставила.", "2019-01-18T16:05:17.60759534Z", "коричневый", "0", 2, 0, 4, "Салфетница \"Элегантная\"", "Artipolis"], "763": ["Очень элегантная.... и  как ни странно...подошла к нашему современному стилю кухни", "2019-01-16T11:39:05.90988585Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "764": ["Раскошная салфетница", "2019-01-13T13:09:26.188509563Z", "коричневый", "0", 2, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "765": ["Купила и салфетницу и чайный домик. Всё очень понравилось.Необычно, оригинально, качественно.Покупала в подарок. Салфетницы этой фирмы беру не в первый раз, всем кому дарила , все в восторге.Упаковано аккуратно. Химического запаха нет.WB спасибо за скидку.", "2019-01-12T12:46:12.705181981Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "766": ["Салфетница отличная, украшает стол, заказала ещё такую же.", "2019-01-10T16:27:56.785342645Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "767": ["Суперские штучки !!!! Полностью согласна со всеми отзывами! Смотрится очень достойно, на подарок не стыдно дарить!!!! Пришли в красиво упакованных коробках , без изъянов ! Из всех вариантов выбрали именно этот, очень изящно выглядят!!!!! 👍👍👍взяла себе и деткам!!!👌", "2019-01-10T10:43:51.282758333Z", "коричневый", "0", 40, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "768": ["Дополню фото! Очень красиво!👍👍👍 берите не задумываясь!!!", "2019-01-10T15:58:13.359286841Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "769": ["Выглядит достойно,на подарок вообще классная вещь", "2019-01-09T17:12:10.633759885Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "770": ["Заказала 3 разных, у одной был треснут лепесток, пришлось отказаться. Вещица красивая, будет радовать)))", "2019-01-08T13:42:42.921398647Z", "коричневый", "0", 1, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "771": ["Очень классная салфетница", "2019-01-08T05:07:49.671542209Z", "коричневый", "0", 12, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "772": ["Салфетка великолепная. Изящная и очень необычная. 10 из 10!!!", "2019-01-06T14:36:55.65945501Z", "коричневый", "0", 8, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "773": ["Эту красавицу заказывала на подарок, расстаться не смогла, оставила себе. Салфетница упакована в красивую коробку. Пришла без брака, что очень приятно. Теперь украшает наш обеденный стол. Красота, очень рада покупке.", "2019-01-06T14:34:25.459087915Z", "коричневый", "0", 6, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "774": ["Порадовала салфетница \"Элегантная\" бренда «Artipolis». Очень красивая и тонкая резьба по фанере, прекрасная задумка, хорошее воплощение и достойное оформление в плотную, красивую, картонную упаковку. Внутри упаковки фигурка зафиксирована специальным твердым, картонным вкладышем, дабы избежать ее поломки, т.к. изделие достаточно хрупкое. Все соответствует фото и параметрам, указанным в каталоге магазина, все продумано до мелочей. Брала несколько разных фигурок этого бренда на подарки к Новому году, все прекрасно. Спасибо всем, особенно производителю!", "2018-12-10T13:46:35.566976918Z", "коричневый", "0", 16, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "776": ["Красивая, необычная. Изящная. С юбкой из салфеток - на большой стол. Одновременно и салфетница и украшение интерьера. ", "2018-12-31T07:17:22.586990465Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "777": ["Заказала на подарки 3 таких салфетницы. Очень красивые! ", "2018-12-30T14:51:34.214999321Z", "коричневый", "0", 15, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "778": ["Возможно идея и неплохая, но вот исполнение не очень. Кусок тонкой крашеной фанеры, да ещё и клей виден. На картинке показалась интересной, думала взять в подарок, да ещё и куча восторженных отзывов, а в живую совсем не понравилось, не стоит и половины этой цены. Отказ без сожаления.", "2018-12-29T20:34:10.622810505Z", "коричневый", "0", 5, 5, 1, "Салфетница \"Элегантная\"", "Artipolis"], "779": ["Купила салфетницы \"Элегантная\", \"Дама в шляпе\", \"Сюзанна\" - себе и на подарки. Просто достать их из коробки требует мастерства и виртуозности. Очень хрупкие, особенности \"лепестки\", куда вставляются салфетки. На одной сразу же сломался один \"лепесток\", оставила ее себе. На всех видны беловатые следы клея. В общем, смотрятся неплохо (на расстоянии). Если бы цена была в два раза ниже, оценку поставила бы выше", "2018-12-29T07:59:10.598053019Z", "коричневый", "0", 3, 3, 3, "Салфетница \"Элегантная\"", "Artipolis"], "780": ["Салфетница замечательная.Салфетки можно складывать по-разному можно экспериментировать,  на фото видно.Заказываю уже в 3 раз т.к.все кто увидят обязательно просят таких красавиц. В подарок вообще прекрасно подходит и упакованы презентабельно. Кто то писал что пахнут и красятся, у меня ничего подобного не было. А небольшой запах присутствует у любой новой вещи, после вскрытия упаковки тут же всё прошло.", "2018-12-28T21:35:11.82830733Z", "коричневый", "0", 13, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "781": ["Просто изумительная салфетница", "2018-12-28T14:11:50.566835529Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "782": ["Чудесное приобретение к Новому Году!!! Да, пачкает немного салфетки, но, думаю, оботрётся. Спасибо автору идеи!", "2018-12-23T19:05:05.988458464Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "783": ["Салфетница красивая,но очень жаль бракованная. Отказ.", "2018-12-23T16:45:27.541373667Z", "коричневый", "0", 0, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "784": ["Шикарная салфетница, пришла в идеальном состоянии, буду заказывать ещё.", "2018-12-23T10:50:27.792239972Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "785": ["Салфетницы красивые, деревянные.  Заказывала три штуки, на одной небольшой брак, но все равно оставила.", "2018-12-22T07:52:33.271385117Z", "коричневый", "0", 5, 1, 4, "Салфетница \"Элегантная\"", "Artipolis"], "786": ["Шикарная салфетница, очень красиво смотрится на столе, давно искала что-нибудь интересное и вот здесь нашла.  Все спрашивают, где такую купила :) Спасибо магазину и производителю!", "2018-12-18T12:59:46.623383342Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "787": ["Очень красивая салфетница.", "2018-12-16T17:22:55.737270511Z", "коричневый", "0", 9, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "788": ["Пришла салфетница в коробке, качество хорошее. Брала на новогодний по подарок, очень классно смотрится", "2018-12-14T14:27:46.05078401Z", "коричневый", "0              ", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "789": ["Просто находка!!!! Довольна покупкой. Рекомендую", "2018-12-13T15:19:27.48178054Z", "коричневый", "0              ", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "790": ["Понравилась! Оригинальная вещица. И на подарок достойно смотрится.", "2018-12-07T08:40:09.915624518Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "791": ["Товар пришел с браком паломана верхняя часть", "2018-12-01T10:22:05.326244604Z", "коричневый", "0", 2, 1, 1, "Салфетница \"Элегантная\"", "Artipolis"], "792": ["Очень симпатичная салфетница.", "2018-11-28T10:08:36.94971939Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "793": ["Самая красивая салфетница! Качественно всё сделано. Беру не первый раз салфетницы этой марки, с каждым разом всё лучше, сейчас даже не пачкает ничего. Хорошо обработаны!!! Супер!", "2018-11-28T09:44:35.443633904Z", "коричневый", "0", 7, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "794": ["Очень красивая, показала подружкам все хотят такую же)", "2018-11-26T14:46:19.465687081Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "795": ["Вещица оригинальная.. Выбор пал именно на эту \"Элегантную\". Очень тонкая работа. Пришло все целым, салфетница красит, но надо протереть 3 раз сухой салфеткой и начинить салфетками и готова такая красота. Рекомендую товар к покупке. Спасибо Wildberries за исполнение желаний.", "2018-11-26T12:31:17.548864681Z", "коричневый", "0", 4, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "796": ["Нашла дефекты, круг куда вставляют салфетки показался под наклоном, хотя наверное было бы не заметно, но брала в подарок хотелось, чтобы идеально было, не взяла", "2018-11-25T17:15:32.065481211Z", "коричневый", "0", 2, 0, 4, "Салфетница \"Элегантная\"", "Artipolis"], "797": ["Сегодня выкупила. Очень довольна. У меня ничего не испачкалось. Ни руки, на салфетки. Заказала еще две по просьбе.", "2018-11-21T17:38:46.557960354Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "798": ["Красивая салфетница, смотрится очень хорошо!", "2018-11-19T14:43:04.436823577Z", "коричневый", "0", 11, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "799": ["Салфетница \"Элегантная\" - эффектное дополнение вашему интерьеру. Заказала всем своим подругам и знакомым в подарок. Очень советую.", "2018-11-08T20:08:39.988939062Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "800": ["Прекрасная вещь! В подарок - самое оно!", "2018-11-02T16:29:37.730140867Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "801": ["Очень оригинальная вещица, смотрится эффектно и необычно. Сделана аккуратно, просто очаровательна, хотя и не маленькая, но на нее можно вполне акцентировать внимание.", "2018-10-05T22:06:35.235802051Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "802": ["Красота! Оригинальная вещица, украшает праздничный стол. Рекомендую.", "2018-10-01T14:11:32.653282498Z", "коричневый", "0", 3, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "803": ["Спасибо интернет магазине за качество товара и за подарок мы вас любим , буте всегда снами !!!", "2018-09-25T06:24:46.052842721Z", "коричневый", "0", 2, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "804": ["Красота!!! Смотрится изящно,глаз не оторвать!", "2018-09-03T17:25:53.729879103Z", "коричневый", "0", 4, 1, 5, "Салфетница \"Элегантная\"", "Artipolis"], "805": ["Давно искала оригинальную и необычную салфетницу из натурального дерева и нашла. Выбор пал именно на эту \"Элегантную\". Очень тонкая, ювелирная работа. Коробка красивая, правда на фото кажется что железная, а в реале картонная. Пришло все целым, салфетница красит, но надо протереть 3 раз сухой салфеткой и начинить салфетками и готова такая красота. Рекомендую товар к покупке. Спасибо Wildberries за исполнение желаний.", "2018-09-03T16:23:09.405702175Z", "коричневый", "0", 18, 2, 5, "Салфетница \"Элегантная\"", "Artipolis"], "806": ["Очень красивая салфетница. Кто-то писал, что занимает много места. Я нашла вариант оформления, благодаря которому можно эту проблему легко решить.", "2018-08-23T20:17:49.430168621Z", "коричневый", "0", 34, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "807": ["ПРЕЛЕСТНАЯ вещица. Не маленькая, очень эффектно смотрится. Рекомендую.", "2018-08-06T12:28:47.149569564Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "808": ["Скупила много разных вариантов этих салфетниц - все красивые,  красится перестают после протирания салфеткой. И я и коллеги довольны! Красиво и оригинально!!", "2018-07-19T08:35:32.90116402Z", "коричневый", "0", 5, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"], "809": ["Заказала три разные салфетницы - на подарок и себе. Салфетницы просто замечательные, необычное решение. Немного красят пальцы, но думаю, что это пока салфетницы новые. Рекомендую.", "2018-07-12T09:18:05.578733984Z", "коричневый", "0", 10, 0, 5, "Салфетница \"Элегантная\"", "Artipolis"]}
